import React from 'react'

const Home = () => {

    const SignUp=()=>{
        let name=document.getElementById("newName").value;
        let email=document.getElementById("newEmail").value;
        let username=document.getElementById("newUsername").value;
        let password=document.getElementById("newPassword").value;
        let phone=document.getElementById("newPhone").value;
        let country=document.getElementById("newCountry").value;
        let city=document.getElementById("newCity").value;
        let pincode=document.getElementById("newPincode").value;
        let regexPhone=/^\d{10}$/;
        let regexEmail=/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/;
        if(regexEmail.test(email)!=true){
            document.getElementById("newEmail").style.border="1px solid red"
        }
    }

  return (
    <div id="containerSignLog">
     <div id="signLog">
     <div id="signUp">
        <p className="signLogHeading">Sign Up</p>
        <div>
          <input placeholder="Enter your name" type="text" id="newName"/>
          <input placeholder="Enter your email" type="email" id="newEmail"/>
          <p id="paraError">Enter valid email</p> 
          <input placeholder="Enter your username" type="text" id="newUsername"/>      
          <input placeholder="Enter new password" type="password" id="newPassword"/>       
          <input placeholder="Enter your number" type="number" id="newPhone"/>  
          <input placeholder="Enter your country" type="text" id="newCountry"/> 
          <input placeholder="Enter your city" type="text" id="newCity"/>  
          <input placeholder="Enter your pincode" type="number" id="newPincode"/> 
        </div>
        <button onClick={SignUp} id="newSubmit">
          Sign Up
        </button>
      </div>
    </div>
  </div>
  )
}

export default Home
